import React from 'react'
import Dialog from '@mui/material/Dialog';
import DialogTitle from '@mui/material/DialogTitle';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';
import { Button, Form, Input, InputNumber } from 'antd';

import ButtonM from '@mui/material/Button';

function EditPatientDialog({open, onClose, data}) {

    const [form] = Form.useForm();

  return (

    <Dialog
    open={open}
    classes={{ paper: "rounded-xl sc2" }}
    maxWidth='lg'
    style={{marginTop:"-250px"}}
    >

        <div style={{paddingTop:"10px", paddingBottom:"10px", width:"630px", paddingLeft:"10px", paddingRight:"10px", display:"flex", flexDirection:"column"}} className="py-6 md:w-[430px] w-[350px] px-5 md:px-0">

        <DialogTitle style={{alignSelf:"center", fontWeight:"550", fontSize:"25px"}} id="responsive-dialog-title">
          Edit Patient Details
        </DialogTitle>

        <DialogContent>

            <Form
                requiredMark={"optional"}
                form={form}
                layout="vertical"
                className="bg-white pl-5 pr-5 md:pl-12 md:pr-12 pt-10 border-0"
                // onFinish={SavaPatient}
                style={{ border: "1px solid #D7EAFB", width:"full" }}
            >

                <Form.Item
                    name={"pid"}
                    label={
                        <label style={{ color: "#03488A" }}>Patient ID</label>
                    }
                    rules={[
                    {
                        required: true,
                        message : "Please input this feild !"
                    },
                    ]}
                >
                    <Input style={{width:"full"}} />
                </Form.Item>

                <Form.Item
                    name={"pid"}
                    label={
                        <label style={{ color: "#03488A" }}>Patient ID</label>
                    }
                    rules={[
                    {
                        required: true,
                        message : "Please input this feild !"
                    },
                    ]}
                >
                    <Input style={{width:"full"}} />
                </Form.Item>

                <Form.Item>

                    

                </Form.Item>
                
            </Form>

        </DialogContent>

        </div>

    </Dialog>

  )

}

export default EditPatientDialog
